import React, { useEffect, useState } from 'react'
import Select from '@mui/material/Select'
import MenuItem from '@mui/material/MenuItem'
function DropdownChanger(props) {
    const [zvalue, setValue] = useState(props.value)
    const handleChange = (event) => {
        console.log(props.value)
        setValue(event.target.value)
        props.onValueChange([props.keyHistory, event.target.value])
    }

    let returnSelect
    if (props.options.differentLabels) {
        returnSelect = (
            <Select disabled={props.isDisabled} size="small" sx={{ mb: 1 }} value={zvalue} onChange={handleChange}>
                {props.options.selections.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                        {option.label}{' '}
                    </MenuItem>
                ))}
            </Select>
        )
    } else {
        returnSelect = (
            <Select disabled={props.isDisabled} size="small" sx={{ mb: 1 }} value={zvalue} onChange={handleChange}>
                {props.options.selections.map((option) => (
                    <MenuItem key={option} value={option}>
                        {option}{' '}
                    </MenuItem>
                ))}
            </Select>
        )
    }
    return returnSelect
}

export default DropdownChanger
